  \"2016-02-22T23:24:17.209883\",\n\t\"name\": \"comparison-of-fishery-independent-methods-for-sampling-main-hawaiian-islands-bottomfish-assemblbde9e\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Optical, active acoustics, and research
  fishing data on bottomfish abundance and biomass were collected over predetermined
  grids to compare results of methodologies.  Optical data were collected using a
  baited stationary Botcam, a TOAD (tethered optical assessment device) camera, and
  a BRUVS (shallow water baited/unbaited underwater video camera system).  Acoustics
  data were collected using a narrow-beam EK60 system operating at 38, 70, and 120
  kHz frequencies.  Research fishing was conducted using hook-and-line on small boats.
  \ Biosampling on some of the fish was carried out including measurement of length
  and weight and preservation of otoliths, gonads, and stomach for post-survey analyses.
  \ Bottomfishing off the Sette were conducted simultaneously with acoustics data
  collection to groundtruth the acoustics data.  CTD-mounted video camera drops we
  conducted simultaneously with acoustics recording to further groundtruth the acoustics
  data.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
